import React from "react"


function Joke(props) {
	console.log(props)
	console.log(props.question)
	if(props.question === undefined) {
		console.log("hell yeah")
	}

	return (
		<div>
			<h3>Question: {props.question}</h3>
			<h3>Punchline: {props.punchline}</h3>
		</div>
	)
}


export default Joke
